    false,nt"url": null,nt"notes": "NCEI Accession 0142630 contains raw underway
    meteorological, navigational, optical, physical, profile and time series data logged
    by the Scientific Computer System (SCS) aboard NOAA Ship Pisces in the Gulf of Mexico
    from 2013-10-22 to 2013-12-07. Office of Marine and Aviation Operations (OMAO) personnel
    aboard the ship submitted these data and associated metadata to NCEI. In addition,
    NCEI Accession 0142630 contains supplementary cruise-level metadata, which OMAO
    personnel logged in the Ship Daily Activity Log (SDAL). OMAO and NCEI personnel
    developed the automated process to archive these data under the auspices of the
